function setup(){createCanvas(displayWidth,displayHeight),enemies=[]}function draw(){for(var e=0;e<enemies.length;e++)rect(int(enemies[e].position.x),int(enemies[e].position.y),20,20)}function mousePressed(){enemies.push(new Enemy)}function Enemy(e){this.type=e,this.color="red",this.position={},this.position.x=400*Math.random(),this.position.y=400*Math.random()}Enemy.prototype.createEntity=function(){return this.color+" "+this.type+" apple"};